import React from "react";

export const generateOptions = (optionList, category) => {
    if(category === "grade") {
        return optionList.map((option) => {
            return (
                <option value={option.gradePoint}>
                {option.grade}
                </option>
            );
        })
    }

    return optionList.map((option) => {
        return (
            <option value={option}>
            {option}
            </option>
        );
    });
}
